import axios from "axios";
import config, { atlAPIUrl,  agtpAPIUrl} from "./config";

axios.defaults.baseURL = config.atlAPIUrl;

export const getAtl = wholeUrl => {

    const requestUrl = atlAPIUrl + wholeUrl;
    return axios.get(requestUrl)
};

export const getAgtp = wholeUrl => {

    const requestUrl = agtpAPIUrl + wholeUrl;
    return axios.get(requestUrl)
};
